import React, { useState } from 'react'
function Login() {
    const email1="pravin"
    const pass1=123
    const [email,setEmail]=useState('')
    const [password,setPassword]=useState('')
    const [allentry, setAllEntry] = useState([])

    const form=(event)=>{
        setEmail(event.target.value)
    }
    const form2=(event)=>{
        setPassword(event.target.value)
    }
    const submit=(e)=>{
        e.preventDefault()

        if(email1==email && pass1==password){
            const newentry={email: email , password: password}
            setAllEntry([...allentry , newentry]  )
            console.log("yours login ")
        }else{
            console.log("error")
        }


    }   
  return (
    <div>
    <form action='' onSubmit={submit}>
    <input type='text' name='email' id='email'  onChange={form} placeholder=' email ' />
    <input type='password' name='password' id='password'   onChange={form2} placeholder=' password '  />
    <button type='submit' >login</button> 

    </form>
    <div>
    {
        allentry.map((e)=>{
        return(
            <div>
            <p>{e.email}</p>
            <p>{e.password}</p>
            </div>    
            )})
    }
    </div>

    </div>
  )
}

export default Login
